window.bookSummaryJSON = "<p>San Francisco's only PI with an eye into the supernatural, is having one of those months. His bad mood drives him to his local pub where he encounters his latest client, a Leprechaun who's lost his adopted niece, a runaway Dryad, and that's where the problems begin.</p> <p>Some days it pours and when Landau Bain, the city's crankiest wizard, arrives on Tony's doorstep, he knows what's coming down isn't rain.</p> <p>Performed by Bradley Smith, Elliot Dash, Andy Brownstein, Yasmin Tuazon, Matthew Keenan, Colleen Delany, Michael John Casey, Kimberly Gilbert, Matthew Pauli, Ken Jackson, Scott McCormick, Patrick Bussink, Richard Rohan, Andy Clemence, Nora Achrati, Eric Messner, Nanette Savard, Todd Scofield, Rose Elizabeth Supan, David Jourdan, Zeke Alton, Alejandro Ruiz, Terence Aselford.</p>"; 
